window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"17.1.1","implementation":{"name":"cucumber-jvm","version":"7.2.3"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"11.0.17+8-LTS"},"os":{"name":"Mac OS X"},"cpu":{"name":"aarch64"}}},{"testRunStarted":{"timestamp":{"seconds":1668036531,"nanos":930644000}}},{"source":{"uri":"file:///Users/kananhuseynov/IdeaProjects/Cydeo_CRM_Group12Project/src/test/resources/features/emp-interaction.feature","data":"Feature: CRM24 employee interaction feature\n\n  User Story: As a user, I should be able to interact with employees on the posts.\n\n  Accounts are: Human Resource, Helpdesk, and Marketing\n\n\n\n\n       #CRMLYEUG-1278\n\n  Scenario Outline: Verify user should be able to make a comment to other employees' posts.\n    Given the user logs in as a \"<userType>\"\n    When user write a \"This is a test comment\" to post\n    And click send button\n    Then \"This is a test comment\" appear under the post\n    Examples:\n      | userType             |\n      | Human Resource_kenan |\n      | Helpdesk_kenan       |\n      | Marketing_kenan      |\n\n\n   #CRMLYEUG-1280\n  @wip\n  Scenario Outline: Verify user should be able to make a like to other employees' posts.\n    Given the user logs in as a \"<userType>\"\n    When user click like button any of employees post\n    Then you was written under the post\n    Examples:\n      | userType             |\n      | Human Resource_kenan |\n      | Helpdesk_kenan       |\n      | Marketing_kenan      |\n\n    #CRMLYEUG-1281\n\n # Scenario: Verify user should be able to unfollow other employees' posts.\n   # When User click unfollow under any of employee post\n   # Then unfollow turns to follow\n\n    #CRMLYEUG-1282\n # Scenario: Verify user should be able to make a like on all other reviewers' comments.\n  #  When user click to like of any reviewers comment\n   # Then like icon appears next to comment\n\n    #CRMLYEUG-1283\n\n#  Scenario: Verify user should be able to make a comment on all other reviewers' comments.\n #   When user click on reply under the comment of any user\n  #  And write something to comment part\n  #  And click send button\n  #  Then message appears under the post with the name of receiver\n\n#    #CRMLYEUG-1284\n#  Scenario: Verify user should be able to like his/her comment\n#    When user write a comment to any post\n#    And click like button of his/her comment\n#    Then Like icon appears next to comment\n#\n#    #CRMLYEUG-1285\n#  Scenario: Verify user should be able to replay his/her comment\n#    When user write a comment to any post\n#    And click reply button under his/her own comment\n#    And write something in comment part\n#    And click send button\n#    Then comment appear under the post\n#\n#    #CRMLYEUG-1286\n#  Scenario: Verify after making a comment user should be able to view comment by clicking more\n#    When user write a comment to any post\n#    And click send button\n#    And click more under the comment he/she wrote\n#    And click view comment\n#    Then user will be directed to new page where post owner name on the header\n#\n#    #CRMLYEUG-1287\n#  Scenario: Verify after making a comment user should be able to copy link by clicking more\n#    When user write a comment to any post\n#    And click send button\n#    And click more under the comment he/she wrote\n#    And click copy link\n#    Then done icon appears next to copy link and link was copied accordingly\n#\n#    #CRMLYEUG-1288\n#  Scenario: Verify after making a comment user should be able to edit comment by clicking more\n#    When user write a comment to any post\n#    And click send button\n#    And click more under the comment he/she wrote\n#    And click edit button\n#    And edit the comment\n#    And click send button\n#    Then previous comment changes to edited one\n#\n#    #CRMLYEUG-1289\n#  Scenario: Verify after making a comment user should be able to delete comment by clicking more\n#    When user write a c window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"17.1.1","implementation":{"name":"cucumber-jvm","version":"7.2.3"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"11.0.14+8-LTS-263"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1668090192,"nanos":494521100}}},{"source":{"uri":"file:///C:/Users/eyela/IdeaProjects/Cydeo_CRM_Group12Project/src/test/resources/features/employee_functions.feature","data":"@CRMLYEUG-1476\r\nFeature:\r\n\r\n  User story: As a user, I should be able to use functions on Company Structure under Employee menu.\r\n\r\n\r\n# AC1. All user types should be able to display company structure.\r\n\r\n  Scenario Outline: The user displays company structure.\r\n    Given the user logs in as a \"<userType>\"\r\n    When the user clicks on Employees button on the left menu\r\n    Then the user displays company structure\r\n    Examples:\r\n      | userType       |\r\n      | Human Resource |\r\n      | Helpdesk       |\r\n      | Marketing      |\r\n\r\n# AC2. Hr user should be able to add a department from the company structure.\r\n\r\n\r\n  Scenario: Hr user add a department from the company structure.\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user types Department name\r\n    And the user adds a department\r\n    Then the user sees the added department on the company structure\r\n\r\n\r\n  Scenario: Department cannot be added without department name\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user leaves Department name empty\r\n    And the user adds a department\r\n    Then the user sees the error message\r\n\r\n# AC3. Hr user should be able to select a parent department from the department dropdown.\r\n\r\n  @WIP2\r\n  Scenario: Hr user selects a parent department from the department dropdown when adding a department.\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n\r\n    And the user clicks on Add Department button\r\n    And the user types Department name\r\n    And the user adds a department\r\n\r\n    And the user clicks on Add Department button\r\n    And the user types child Department name\r\n    And the user selects a parent department from the department dropdown\r\n    And the user adds a department\r\n    Then the user sees the added department under parent department on the company structure\r\n\r\n# AC4. Hr user should be able to select a supervisor from \"recent\", \"company\" and \"search\"\r\n\r\n\r\n  Scenario: Hr user selects a supervisor from \"recent\" when adding a department.\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user types Department name\r\n    And the user selects supervisor from recent\r\n    And the user adds a department\r\n    Then the user sees the added department on the company structure\r\n\r\n\r\n  Scenario: Hr user selects a supervisor from \"company\" when adding a department.\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user types child Department name\r\n    And the user selects supervisor from company\r\n    And the user adds a department\r\n    Then the user sees the added department on the company structure\r\n\r\n\r\n  Scenario: Hr user selects a supervisor from \"search\" when adding a department.\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user types Department name\r\n    And the user searches and selects supervisor \"Kara Murat\" from search\r\n    And the user adds a department\r\n    Then the user sees the added department on the company structure\r\n\r\n#AC5. Hr user should be able to close add department pop-up at any time before sending\r\n\r\n\r\n  Scenario: Hr user can close add department pop-up at any time before sending\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user clicks on Close button\r\n    Then add department pop-up is closed\r\n\r\n\r\n  Scenario: Hr user can close add department pop-up at any time before sending\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user types Department name\r\n    And the user clicks on Close button\r\n    Then add department pop-up is closed\r\n\r\n\r\n  Scenario: Hr user can close add department pop-up at any time before sending\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user types Department name\r\n    And the user selects a parent department from the department dropdown\r\n    And the user clicks on Close button\r\n    Then add department pop-up is closed\r\n\r\n\r\n  Scenario: Hr user can close add department pop-up at any time before sending\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user types Department name\r\n    And the user selects supervisor from recent\r\n    And the user clicks on Close button\r\n    Then add department pop-up is closed\r\n\r\n\r\n  Scenario: Hr user can close add department pop-up at any time before sending\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user types Department name\r\n    And the user selects supervisor from company\r\n    And the user clicks on Close button\r\n    Then add department pop-up is closed\r\n\r\n\r\n  Scenario: Hr user can close add department pop-up at any time before sending\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user types Department name\r\n    And the user searches and selects supervisor \"Kara Murat\" from search\r\n    And the user clicks on Close button\r\n    Then add department pop-up is closed\r\n\r\n#AC6. Hr user should be able to edit departments, add child departments, and delete departments after adding the department.\r\n\r\n  Scenario: Hr user can edit departments after adding the department.\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user types Department name\r\n    And the user adds a department\r\n    And the user edits the department\r\n    Then the department is edited\r\n\r\n\r\n  Scenario: Hr user can add child departments after adding the department.\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user types Department name\r\n    And the user adds a department\r\n    And the user adds child department\r\n    Then the user sees the added department under parent department on the company structure\r\n\r\n\r\n  @WIP\r\n  Scenario: Hr user can add child departments after adding the department.\r\n    Given the user logs in as a \"Human Resource\"\r\n    When the user clicks on Employees button on the left menu\r\n    And the user clicks on Add Department button\r\n    And the user types Department name\r\n    And the user adds a department\r\n    And the user deletes the department\r\n    Then the department is deleted\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/eyela/IdeaProjects/Cydeo_CRM_Group12Project/src/test/resources/features/employee_functions.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@CRMLYEUG-1476","id":"7eed7a2d-d957-4dca-9680-d8d95423e29b"}],"language":"en","keyword":"Feature","name":"","description":"  User story: As a user, I should be able to use functions on Company Structure under Employee menu.","children":[{"scenario":{"location":{"line":9,"column":3},"tags":[],"keyword":"Scenario Outline","name":"The user displays company structure.","description":"","steps":[{"location":{"line":10,"column":5},"keyword":"Given ","text":"the user logs in as a \"<userType>\"","id":"e839e2bd-34ba-4552-a708-144feec78de5"},{"location":{"line":11,"column":5},"keyword":"When ","text":"the user clicks on Employees button on the left menu","id":"e65831d7-0fd2-4b38-adbd-e8e2b354eef2"},{"location":{"line":12,"column":5},"keyword":"Then ","text":"the user displays company structure","id":"5ad022af-dd34-4578-ad34-67d91e7a06b8"}],"examples":[{"location":{"line":13,"column":5},"tags":[],"keyword":"Examples","name":"","description":"","tableHeader":{"location":{"line":14,"column":7},"cells":[{"location":{"line":14,"column":9},"value":"userType"}],"id":"4b4d7bde-b3e2-42f1-a93b-eeabe2b9fe62"},"tableBody":[{"location":{"line":15,"column":7},"cells":[{"location":{"line":15,"column":9},"value":"Human Resource"}],"id":"28c14925-92fc-42ca-ad78-baf10fa3c20b"},{"location":{"line":16,"column":7},"cells":[{"location":{"line":16,"column":9},"value":"Helpdesk"}],"i
